import Header from "../Header/Header";
import BoothBtn from "../BoothBtn/BoothBtn";
import BoothDescription from "../BoothDescription/BoothDescription";
import ReviewCard from "../ReviewCard/ReviewCard";
import Button from "../Button/Button";
import BottomTapBar from "../BottomTapBar/BottomTapBar";
import styled from "styled-components";
import sw from "../../images/stamp-sw.png";
import WriteReviewButton from "../Button/Button";
import art from "../../images/stamp-art.png";

function QRStamp()
{
    return <Wrap>
        <Header name={"스탬프 모아보기"}></Header>
        <Container>
            <WrapIcon>
                <img className={"img"} src={sw}/>
            </WrapIcon>
            <WrapIcon>
                <img className={"img"} src={art}/>
            </WrapIcon>
        </Container>

    </Wrap>
}

const Wrap = styled.div`
    width: 100%;
    text-align: center;
    margin: 0 auto;
`;

const Container = styled.div`
    maring:10px;
    text-align : center;
`
const WrapIcon = styled.div`
    flex : 1;
    maring:10px;
    text-align : center;
`


export default QRStamp
